import './ExpenseDate.css';

function ExpenseDate(props) {
    const month = new Date().toLocaleString([], { month: 'long', }); //props.date.toLocaleString('en-US', {month: 'long'});
    const day = new Date().getDay //props.date.toLocaleString('en-US', {day: '2-digit'});
    const year = new Date().getFullYear //props.date.prototype.getFullYear();

    return (
        <div className="expense-date">
            <div className="expense-date__day">{day}</div>
            <div className="expense-date__month">{month}</div>
            <div className="expense-date__year">{year}</div>
        </div>
    );
}

export default ExpenseDate;
